typedef struct
{
    char *keys[MAX_SIZE];
    float values[MAX_SIZE];
    int curIndex;
} ArrayDictionary;

void Initialize(ArrayDictionary *ad)
{
    ad->curIndex = 0;
}

void Store(ArrayDictionary *ad, char *key, float value)
{
    if (ad->curIndex >= MAX_SIZE - 1)
    {
        exit(EXIT_FAILURE);
    }
    ad->keys[ad->curIndex] = key;
    ad->values[ad->curIndex] = value;
    ad->curIndex++;
}

float Fetch(ArrayDictionary *ad, char *key)
{
    for (int i = 0; i < ad->curIndex; i++)
    {
        if (strcmp(key, ad->keys[i]) == 0)
        {
            return ad->values[i];
        }
    }
    return 0.0;
}

void AnalyzeWithArrayDictionary(char **dates, float *values, int numDates)
{
    struct timeval startTime;
    struct timeval endTime;
    ArrayDictionary ad;
    Initialize(&ad);
    float storeTime = 0., fetchTime = 0.;

    /* Added some timings around this. */
    gettimeofday(&startTime, 0);
    for (int i = 0; i < numDates; i++)
        Store(&ad, dates[i], values[i]);
    gettimeofday(&endTime, 0);
    storeTime = (endTime.tv_sec - startTime.tv_sec) + (endTime.tv_usec - startTime.tv_usec) / 1000000.0;
    printf("Store time with Array-Based Dictionary is %f\n", storeTime);

    gettimeofday(&startTime, 0);
    for (int i = 0; i < numDates; i++)
    {
        /*
        //  For each date, do a fetch and compare against the correct number.
        //  DO NOT TOUCH ANY CODE IN THIS LOOP.
        */
        int idx = (4 * i) % numDates;
        float val = Fetch(&ad, correct_dates[idx]);
        float op = correct_open_price[idx];
        if (val != op)
        {
            if (op < 0.)
            {
                /* fake date not contained in DJIA file -- just continue */
                continue;
            }

            printf("Bad fetch of date %s, correct val is %0.02f, but you returned %0.02f!\n",
                   correct_dates[idx], op, val);
            exit(EXIT_FAILURE);
        }
    }
    gettimeofday(&endTime, 0);
    fetchTime = (endTime.tv_sec - startTime.tv_sec) + (endTime.tv_usec - startTime.tv_usec) / 1000000.0;

    printf("All fetches matched, time is %f!\n", fetchTime);
}

int main()
{
    ArrayDictionary ad;
    Initialize(&ad);
    FILE *f = fopen("DJIA", "r");
    if (f == NULL)
    {
        fprintf(stderr, "Unable to open file \"DJIA\" ... did you copy it to the current directory?\n");
        exit(EXIT_FAILURE);
    }

    char **dates = malloc(sizeof(char *) * NUM_DATES);
    float *values = malloc(sizeof(float) * NUM_DATES);
    if (dates == NULL || values == NULL)
    {
        fprintf(stderr, "Memory allocation failed!\n");
        exit(EXIT_FAILURE);
    }

    /*
    //  Parse the file and place contents in the Dictionary.
    //  The key should be the date (a char *)
    //  The value should be the opening price.  (look at DJIA for more info)
    */
    size_t size = 1024;
    char *buffer = malloc(size * sizeof(char));

    int count = 0;
    while (getline(&buffer, &size, f) > 0)
    {
        char *theDate = NULL;
        float theValue = 0.;

        char date[25];
        float openval = 0.0;

        sscanf(buffer, "%s %f", date, &openval);
        theDate = strdup(date);
        theValue = openval;
        Store(&ad, theDate, theValue);

        if (theDate == NULL)
        {
            printf("You never set a value for theDate.  Exiting.\n");
            exit(EXIT_FAILURE);
        }
        dates[count] = theDate;
        values[count] = theValue;
        count++;
    }

    AnalyzeWithArrayDictionary(dates, values, NUM_DATES);

    free(buffer);
    for (int i = 0; i < count; i++)
    {
        free(dates[i]);
    }
    free(dates);
    free(values);
    fclose(f);
}
